<!DOCTYPE html>
<html>
<head>
    <title>Maaf, session anda telah habis!</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            background-color: #f0f0f0;
            margin: 0;
            padding: 0;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100vh;
        }
        .container {
            max-width: 500px;
            background-color: #fff;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
            border-radius: 5px;
            padding: 20px;
            margin: 10px;
        }
        .error-message {
            color: red;
        }
        .footer {
            background-color: #0692d5; /* Warna biru */
            color: #fff;
            text-align: center;
            padding: 10px;
            width: 100%;
            position: absolute;
            bottom: 0;
        }
    </style>
</head>
<body>
    <div class="container">
        <div style="text-align: center;">
            <img style="height: 100px;" src="data:image/png;base64, " />
        </div>

        <h2 class="error-message" style="text-align: center;">Maaf, session anda telah habis!</h2>
        <hr>
        <p style="font-size: 16px; text-align: center;">
            <b>Silahkan refresh halaman ini atau kembali ke Beranda</b>
            <br>
            <a href="{{ url('/') }}">
                <button style="margin-top: 20px; padding: 10px 20px; background-color: #0692d5; color: #fff; border: none; border-radius: 5px; cursor: pointer;">Beranda</button>
            </a>
        </p>
        
    </div>
    <div class="footer">
        &copy; <span id="tahun-container"></span>. {{ env('APP_NAME') }}.
    </div>

    <script>
        // Mendapatkan tahun saat ini
        const tahunSekarang = new Date().getFullYear();
        const tahunContainer = document.getElementById('tahun-container');
        tahunContainer.textContent = `${tahunSekarang}`;
    </script>
</body>
</html>